Ingredienti per 8 muffins:
120 g farina
15 g Grana Padano grattugiato
1 uovo
100 g latte
30 g olio evo
mezza bustina di lievito
sale
mezza zucchina
70 gr pancetta

Mescolare insieme in una ciotola la farina, il sale, l'olio, l'uovo, il lievito e poco alla volta il latte. Sbattere con una frusta per creare un composto omogeneo e aggiungere il Grana. Versare poi due terzi delle zucchine a cubetti e della pancetta dentro il composto e mescolare. Riempire i pirottini con il composto e decorarne la superficie con le restanti zucchine e pancetta. Infornare in forno caldo a 180 gradi per circa 20/23 minuti.

